import React from "react";
import classes from "./Post.module.css";


function Post() {
    return (
        <div>
            <div> New Post</div>

            <div className='posts'>
                <div className={`${classes.item} ${classes.itemActive}`}>

                    POSTS 1

                </div>
                <div className={classes.item}>

                    POSTS 2

                </div>
            </div>
        </div>
    )
}

export default Post
